// x,y -> sqrtm1 [-> x,y]
//
// https://t5k.org/primes/lists/all.txt
// 2147  10^999999+308267*10^292000+1     1000000 CH10  2021
//
// f=sqrtm1.smallest_known_1million_digit_prime
//
// either
//   g++ $f.cc -lgmp -lgmpxx -O3 -o $f
// or
//   g++ $f.cc -lgmp -lgmpxx -O3 -o $f -lpari -DPARI
//
#include <time.h>
#include <gmpxx.h>
#include <assert.h>

#include <iostream>

#ifdef PARI
#include <pari/pari.h>

// from: https://mersenneforum.org/showpost.php?s=1b4a66ceb4c359463161f3d6451771c4&p=626367&postcount=13
/*******************************/
/*                             */
/*         GEN --> mpz         */
/*                             */
/*******************************/
void mpz_set_GEN(mpz_ptr z, GEN x) {
    /* Sets z to x, which needs to be of type t_INT. */
    const long lx = lgefint(x) - 2;
    const long sign = signe(x);
    int i;

    assert (sizeof(long) == sizeof(mp_limb_t));

    if (typ(x) != t_INT)
        pari_err_TYPE("mpz_set_GEN", x);

    if (sign == 0) {
        mpz_set_ui(z, 0);
    } else {
        mpz_realloc2(z, (mp_bitcnt_t) lx * BITS_IN_LONG);
        z->_mp_size = static_cast<int>(sign * lx);
        for (i = 0; i < lx; i++)
            (z->_mp_d)[i] = (mp_bitcnt_t)(*int_W (x, i));
    }
}

/*******************************/
/*                             */
/*        mpz --> GEN          */
/*                             */
/*******************************/
GEN mpz_get_GEN(mpz_srcptr z) {
    /* Returns the GEN of type t_INT corresponding to z. */
    const long lz = z->_mp_size;
    const long lx = labs(lz);
    const long lx2 = lx + 2;
    int i;
    GEN x = cgeti(lx2);

    assert (sizeof(long) == sizeof(mp_limb_t));

    x[1] = (long int)
        (evalsigne((lz > 0 ? 1 : (lz < 0 ? -1 : 0)))
        | (unsigned long int) evallgefint(lx2));
    for (i = 0; i < lx; i++)
        *int_W (x, i) = (long int) ((z->_mp_d)[i]);

    return x;
}
#endif


int main(int argc, char *argv[]) {
    mpz_class a, b, c, p, sqrtm1;

    mpz_class x("");
    mpz_class y("");

    mpz_ui_pow_ui(p.get_mpz_t(), 10, 292000);
    p *= mpz_class(308267);
    mpz_ui_pow_ui(b.get_mpz_t(), 10, 999999);
    p += b;
    p += 1;

    assert(x*x + y*y == p);

    std::cout << "a = y^(-1) (mod p) [powm]; a *= x; a %= p" << "\n";
    clock_t start = clock();
    c = -1;
    mpz_powm(a.get_mpz_t(), y.get_mpz_t(), c.get_mpz_t(), p.get_mpz_t());
    a *= x;
    a %= p;
    std::cout << static_cast<float>(clock() - start) / CLOCKS_PER_SEC << "s\n";
    sqrtm1 = a;

    assert((sqrtm1*sqrtm1 % p) == p-1);

#ifdef PARI
    pari_init(2000000000, 0);

    std::cout << "[M,V] = halfgcdii(sqrtm1, p)" << "\n";
    start = clock();
    GEN X = mpz_get_GEN(sqrtm1.get_mpz_t());
    GEN Y = mpz_get_GEN(p.get_mpz_t());

    GEN MV = halfgcdii(X, Y);
    std::cout << static_cast<float>(clock() - start) / CLOCKS_PER_SEC << "s\n";

    std::cout << "[x,y] = [V[2], M[2,1]]" << "\n";
    start = clock();
/*
    assert(typ(MV) == t_VEC);
    assert(typ(gel(MV, 1)) == t_MAT);
    assert(typ(gel(MV, 2)) == t_COL);
    assert(typ(gmael2(gel(MV, 1), 2, 1)) == t_INT);
    assert(typ(gel(gel(MV, 2), 2)) == t_INT);
*/
    mpz_set_GEN(x.get_mpz_t(), gel(gel(MV, 2), 2));
    mpz_set_GEN(y.get_mpz_t(), gmael2(gel(MV, 1), 1, 2));
    std::cout << static_cast<float>(clock() - start) / CLOCKS_PER_SEC << "s\n";

    assert(x*x + y*y == p);
#endif

    std::cout << "done\n";
    return 0;
}
